import styles from "./AppCard.module.css"

function AppCard(props) {
    return (
        <div className={styles.card}>
            <img src={props.iconUrl} alt="" />
            <h2>{props.appName}</h2>
            <h3></h3>
            <span></span>
        </div>
    )
}

export default AppCard
